	add("mercy", "{\"term\":\"mercy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) \u0027merci\u0027 from Anglo-norman \u0027merci\u0027 (compare Old french (842-ca. 1400) \u0027merci\u0027 \u0027mercit\u0027 , from Latin {{m|la|mercēdem}}, accusative of \u0027merces\u0027 from \u0027merx\u0027 (wares, merchandise) Displaced native Middle English \u0027are\u0027 \u0027ore\u0027 \u0026quot;mercy\u0026quot; (from Old English {{m|ang|ār}} \u0026quot;mercy, grace\u0026quot;), Middle English \u0027mildse\u0027 \u0026quot;mercy, clemency\u0026quot; (from Old English \u0027milds\u0027 \u0027milts\u0027 \u0026quot;mercy, kindness\u0026quot;). See {{l/en|milse}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"relenting; forbearance to cause or allow harm to anothe\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"forgiveness or compassion, especially toward those less fortunate\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A tendency toward forgiveness, pity, or compassio\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Instances of forbearance or forgiveness\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A blessing, something to be thankful for\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Subjugation, power\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d1|passage\u003dThe stories did not seem to me to touch life. […] They left me with the impression of a well-delivered stereopticon lecture, with characters about as life-like as the shadows on the screen, and whisking on and off, at the \u0027\u0027mercy\u0027\u0027 of the operator\", \"priority\":7}]}, \"synonyms\":{}}");

	add("mercaptan", "{\"term\":\"mercaptan\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\", \"Latin\"], \"text\":\"From German \u0027mercaptan\u0027 coined from Latin \u0027mercurius\u0027 \u0027captans\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of a class of organic compounds of sulphur, ( R\u0026lt;sub\u0026gt;1\u0026lt;/sub\u0026gt;.S.R\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt; ); they tend to be foul-smelling. When R\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt; is a hydrogen atom, they are termed thiols or thioalcohols\", \"priority\":1}]}, \"synonyms\":{}}");

