	add("mercer", "{\"term\":\"mercer\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027marcer\u0027 \u0027mercer\u0027 (merchant, textile merchant) from \u0027merz\u0027 (commodity) (from Latin \u0027merx\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A merchant dealing in fabrics and textiles, especially silks and other fine cloths\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1600,\u0027\u0027 Ben Jonson, \u0027Cynthia\u0027s Revels\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Acolastus-Polypragmon-Asotus, is here present (by the help of his \u0027\u0027mercer\u0027\u0027, tailor, milliner, sempster, and so forth) at his designed hour\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1922,\u0027\u0027 James Joyce, \u0027Ulysses\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"He passed, dallying, the windows of Brown Thomas, silk \u0027\u0027mercers\", \"priority\":5}]}, \"synonyms\":{}}");

