	add("mercian", "{\"term\":\"mercian\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\"], \"text\":\"From \u0027\u0027 {{suffix||an|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A native or inhabitant of the Anglo-Saxon kingdom of Mercia\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1590\u0027\u0027, \u0027The Faerie Queene\u0027, III.3\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And comming forth shall spred his banner brave / Over the troubled South, that it shall make / The warlike \u0027\u0027Mertians\u0027\u0027 for feare to quake\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The dialect of Old English spoken in Mercia\", \"priority\":4}]}, \"synonyms\":{}}");

