	add("mercury", "{\"term\":\"mercury\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A metal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A silvery-colored, toxic, metallic chemical element, liquid at room temperature, with atomic number 80 and symbol Hg\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"One of the elemental principles formerly thought to be present in all metals\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Ambient pressure or temperature (\u0027from the use of mercury in barometers and thermometers\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027mercury\u0027\u0027 there has averaged 37.6C, 2.3C above the February norm\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Liveliness, volatility\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Bishop Burne\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"He was so full of \u0027\u0027mercury\u0027\u0027 that he could not fix long in any friendship, or to any design\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A plant\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"An annual plant, formerly grown for its medicinal properties; French mercury\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1653\u0027\u0027, \u0027The English Physician Enlarged\u0027, Folio Society 2007, p. 188\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Towards the tops of the stalks and branches come forth at every joint in the male \u0027\u0027Mercury\u0027\u0027 two small round green heads, standing together upon a short footstalk, which growing ripe are the seeds, not having any flower\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A similar edible plant, otherwise known as English mercury or allgood\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The poison oak or poison ivy\", \"priority\":14}]}, \"synonyms\":{}}");

	add("mercury", "{\"term\":\"mercury\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027mercurius\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The Roman god associated with speed, sometimes used as a messenger. He wore winged sandals. Mercury corresponded to the Greek god Hermes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The planet in the solar system with the closest orbit to the Sun, named after the god; represented by ☿\", \"priority\":2}]}, \"synonyms\":{}}");

