	add("merger", "{\"term\":\"merger\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|merge|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or process of merging two or more parts into a single unit\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Club \u0027\u0027mergers\u0027\u0027 reduced the number of teams by hal\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The legal union of two or more corporations into a single entity, typically assets and liabilities being assumed by the buying party\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An absorption of one or more estate(s) or contract(s) into one other, all being held by the same owner; of several counts of accusation into one judgement, etc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A type of sound change where two or more sounds merge into one\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"the cot-caught merger\", \"priority\":6}]}, \"synonyms\":{}}");

