	add("merguy", "{\"term\":\"merguy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|mer|guy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A male merperson\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Ellen Titlebaum, \u0027Sabrina Down Under\u0027, Archway (1999), ISBN 0671047523, [http://books.google.com/books?id\u003dM5XhljL2Kd0C\u0026amp;pg\u003dPA32\u0026amp;dq\u003d%22merguys%22 page 32\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;I don\u0027t know. But he\u0027s still breathing, or whatever it is \u0027\u0027merguys\u0027\u0027 do. We\u0027ve got to try and revive him somehow,\u0026quot; said Sabrina thoughtfully\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Zoraida Cordova, \u0027The Vicious Deep\u0027, Sourcebooks Fire (2012), ISBN 9781402265112, [http://books.google.com/books?id\u003d5DUC-JYFogMC\u0026amp;pg\u003dPT75\u0026amp;dq\u003d%22merguy%22 unnumbered page\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Step right up and see the merboy, \u0027\u0027merguy\u0027\u0027, merman. Where does his ding-dong go\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Suzanne Johnson, \u0027River Road\u0027, Tor (2012), ISBN 9780765327802, [http://books.google.com/books?id\u003d3BfVeHYsvUAC\u0026amp;pg\u003dPT43\u0026amp;dq\u003d%22merguys%22 unnumbered page\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"“Here, entertain yourself. I\u0027m only expecting \u0027\u0027merguys\u0027\u0027 to be at the meeting today, and there are no pictures of them.” Either the male mers didn\u0027t get out much or, more likely, men had written all the history books\", \"priority\":7}]}, \"synonyms\":{}}");

	add("merit", "{\"term\":\"merit\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027lang\u003denm\u0027 from Old french (842-ca. 1400) \u0027lang\u003dfro\u0027 from Latin \u0027lang\u003dla|meritum\u0027 () neuter of \u0027lang\u003dla\u0027 past participle of \u0027lang\u003dla|mereō\u0027 () akin to Ancient greek (to 1453) \u0027μέρος|lang\u003dgrc\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something deserving positive recognition\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"His reward for his \u0027\u0027merit\u0027\u0027 was a check for $50\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Something worthy of a high rating\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A claim to commendation or reward\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The quality of deserving reward\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Reputation is oft got without \u0027\u0027merit\u0027\u0027, and lost without deserving\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Alexander Pop\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"To him the wit of Greece and Rome was known, / And every author\u0027s \u0027\u0027merit\u0027\u0027, but his own\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Reward deserved; any mark or token of excellence or approbation\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"His teacher gave him ten \u0027\u0027merits\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"those laurel groves, the \u0027\u0027merits\u0027\u0027 of thy yout\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The quality or state of deserving either good or bad; desert\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Be it known, that we, the greatest, are misthought / For things that others do; and when we fall, / We answer others\u0027 \u0027\u0027merits\u0027\u0027 in our name\", \"priority\":15}]}, \"synonyms\":{}}");

	add("meritocracy", "{\"term\":\"meritocracy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"\u0027merit\u0027 from Latin {{m|la|mereō||earn}} + \u0027\u0027 from Ancient greek (to 1453) \u0027κράτος\u0027 (strength, power) Coined in 1958 by w:Michael Young (politician)|Michael Young, in his book \u0027Rise of the Meritocracy.\u0027\u0026lt;ref name\u003d\u0026quot;young\u0026quot;\u0026gt;[http://www.guardian.co.uk/politics/2001/jun/29/comment Down with meritocracy], by Michael Young, in The Guardian, June 29, 2001.\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Rule by merit, and talent\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A type of society where wealth, income, and social status are assigned through competition\", \"priority\":2}]}, \"synonyms\":{}}");

	add("merits", "{\"term\":\"merits\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Intrinsic advantages, as opposed to political or procedural advantages\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"I was the boss\u0027s pet project, but was rejected on the \u0027\u0027merits\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Substance, distinguished from form or procedure\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027merits\u0027\u0027 of the case favored the plaintiffs, but their procedural blunders set them back\", \"priority\":4}]}, \"synonyms\":{}}");

	add("merkid", "{\"term\":\"merkid\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|mer|kid|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A young mermaid or merman\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, \u0026quot;Q\u0026amp;A with Aimee Friedman\u0026quot;, in Aimee Friedman, \u0027Ocean of Secrets\u0027, Scholastic Children\u0027s Books (2012), ISBN 9781407135434, [https://books.google.com/books?id\u003dx41GBAAAQBAJ\u0026amp;pg\u003dPT277\u0026amp;dq\u003d%22merkids%22 unnumbered page\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Here\u0027s hoping they get married and spend their days swimming in the sun, \u0027\u0027merkids\u0027\u0027 in tow\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Debbie Dadey, \u0027Whale of a Tale\u0027, Aladdin (2012), ISBN 9781442429840, [https://books.google.com/books?id\u003d3cZbfoLFLkQC\u0026amp;pg\u003dPA16\u0026amp;dq\u003d%22merkid%22 pages 16-17\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Humpback whales were huge. All they had to do to swallow a mermaid was open their gigantic mouths wide. She was the smallest \u0027\u0027merkid\u0027\u0027 in their class\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2015\u0027\u0027, Janet Gurtler, \u0027Cora\u0027s Decision\u0027, Stone Arch Books (2015), ISBN 9781434296955, [https://books.google.com/books?id\u003dPknmBQAAQBAJ\u0026amp;pg\u003dPA30\u0026amp;dq\u003d%22merkid%22 page 30\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Every \u0027\u0027merkid\u0027\u0027 in the entire gymnasium seemed to be holding their breaths\", \"priority\":7}]}, \"synonyms\":{}}");

	add("merlad", "{\"term\":\"merlad\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|mer|lad|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A young male merperson\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Susan K. Hamilton, \u0027Darkstar Rising\u0027, Xlibris (2003), ISBN 1413406246, [http://books.google.com/books?id\u003dc04wezzUNzMC\u0026amp;pg\u003dPA433\u0026amp;dq\u003d%22merlad%22 page 433\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027merlad\u0027\u0027 and merlass watched the sphere for a moment and with a flick of their shiny tails, vanished again\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, S. L. Bynum, \u0027Kalena, the Sea Princess\u0027, Lulu (2006), ISBN 9781430303367, [http://books.google.com/books?id\u003dsFeQP1gUFT0C\u0026amp;pg\u003dPA10\u0026amp;dq\u003d%22merlad%22 page 10\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I have to admit, he\u0027s a handsome \u0027\u0027merlad\u0027\u0027 with his beautiful brown eyes, shiny black hair, and dark brown skin, but I can\u0027t have a boyfriend\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Nancy Farmer, \u0027The Islands of the Blessed\u0027, Simon \u0026amp; Schuster (2009), ISBN 9781847386304, [http://books.google.com/books?id\u003d0wsHphJcjdYC\u0026amp;pg\u003dPT208\u0026amp;dq\u003d%22merlad%22 unnumbered page\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"“At first everyone was standoffish and now they\u0027re too friendly,” Thorgil complained, swiping at a \u0027\u0027merlad\u0027\u0027 who was attempting to grab her hair\", \"priority\":7}]}, \"synonyms\":{}}");

	add("merlot", "{\"term\":\"merlot\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\"], \"text\":\"From French a diminutive of \u0027merle\u0027 (blackbird)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A dark-blue variety of wine grap\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A dry red wine of a certain French type, made from Merlot grapes\", \"priority\":2}]}, \"synonyms\":{}}");

