	add("mermaid", "{\"term\":\"mermaid\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) {{m|enm|mermayde||maid of the sea}}, from {{m|enm|mere||sea, lake}} + {{m|enm|maid}}, equivalent to {{prefix|mer|maid|lang\u003den}}. Compare Old english (ca. 450-1100) {{m|ang|meremenn}}, {{m|ang|meremennen}}, {{m|ang|meremenin||mermaid, siren}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mythological creature with a woman\u0027s head and upper body, and a tail of a fish\", \"priority\":1}]}, \"synonyms\":{}}");

	add("merman", "{\"term\":\"merman\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"middle english (1100-1500)\", \"Dutch\"], \"text\":\"From Middle english (1100-1500) \u0027mereman\u0027 from Old english (ca. 450-1100) *\u0027\u0027 (meremann) (suggested by Old english (ca. 450-1100) \u0027meremenn\u0027 \u0027meremennen\u0027 \u0027meremenin\u0027 (mermaid, siren) equivalent to {{prefix|mer|man|lang\u003den}}. Cognate with Dutch \u0027meerman\u0027 (merman) German \u0027meermann\u0027 (merman)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A legendary creature, human male from the waist up, fishlike from the waist down\", \"priority\":1}]}, \"synonyms\":{}}");

	add("merogamy", "{\"term\":\"merogamy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027mérogamie\u0027 corresponding to {{confix|mero|gamy|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Merogony\", \"priority\":1}]}, \"synonyms\":{}}");

	add("merohedry", "{\"term\":\"merohedry\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition of a crystal whose point group is a subgroup of that of its lattice\", \"priority\":1}]}, \"synonyms\":{}}");

	add("meronym", "{\"term\":\"meronym\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"{{confix|mero|onym|lang\u003den}}, from Ancient greek (to 1453) \u0027μέρος\u0027 (part) + \u0027ὄνομα\u0027 (name)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A term used to denote a thing that is a part of something else\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"quot;Wheels\u0026quot; is a \u0027\u0027meronym\u0027\u0027 of the word \u0026quot;automobile\u0026quot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, George A. Miller, “Nouns in WordNet”, in Christiane Fellbaum (editor), \u0027Wordnet: An Electronic Lexical Database\u0027,\u0026lt;sup \u0026gt;[http://books.google.com/books?id\u003dRehu8OOzMIMC ]\u0026lt;/sup \u0026gt; MIT Press, ISBN 0-262-06197-X, page 38\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"If one starts with some complex whole, like {\u0027automobile\u0027} or {\u0027human_body\u0027}, it can be broken down into several levels of \u0027\u0027meronyms\u0027\u0027, but many of those \u0027\u0027meronyms\u0027\u0027 will also be \u0027\u0027meronyms\u0027\u0027 of other wholes. That is to say, some components serve as parts of many different things: think of all the different mechanisms that have gears\", \"priority\":4}]}, \"synonyms\":{}}");

	add("meropia", "{\"term\":\"meropia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|mero|opia|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Partial blindness\", \"priority\":1}]}, \"synonyms\":{}}");

	add("meroplankton", "{\"term\":\"meroplankton\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|mero|plankton|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any organism that spends part of its life-cycle (especially the larval stage) as plankton\", \"priority\":1}]}, \"synonyms\":{}}");

