	add("merovingian", "{\"term\":\"merovingian\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027mérovingien\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of a Salian Frankish dynasty that came to rule the Franks in a region (known as \u0027Francia\u0027 in Latin) largely corresponding to ancient Gaul from the middle of the 5th century, and whose politics involved frequent civil warfare among branches of the family\", \"priority\":1}]}, \"synonyms\":{}}");

