	add("merseybeat", "{\"term\":\"merseybeat\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|Mersey|beat|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The characteristic style of music produced by pop groups from Merseyside between 1958 and 1964, typified by the w:The Beatles\", \"priority\":1}]}, \"synonyms\":{}}");

	add("merteen", "{\"term\":\"merteen\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|mer|teen|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A teenage merperson\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Virginia Vitzthum, \u0026quot;[http://www.salon.com/2000/02/08/sprinkle/ Annie Sprinkle swims forward]\u0026quot;, \u0027Salon\u0027, 8 February 2000\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In the “how to make a porn video” within the video, Sprinkle plays an older mermaid who sexually initiates a “\u0027\u0027merteen\u0027\u0027” played by Sirena\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Rachel Roberts, \u0027The Heart of Avalon\u0027, CDS Books (2005), ISBN 9781593150136, [http://books.google.com/books?id\u003dx1RMT9kz8twC\u0026amp;q\u003d%22the+merteen%22 page 120\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Realization filled the \u0027\u0027merteen\u0027\u0027s eyes with sadness\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Maria Denardo, \u0026quot;[http://issuu.com/dailyfrontrow/docs/dailydan07272012 Rockefeller\u0027s Center]\u0026quot;, \u0027The Daily Dan\u0027, 27 July 2012\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"I paddle board, boogie board, and I use a monofin when I swim. You put your two feet in a fin and workout in the water. It’s a great way for merfolk—mermen, \u0027\u0027merteens\u0027\u0027, whoever—to connect with the water\", \"priority\":7}]}, \"synonyms\":{}}");

	add("merveilleuse", "{\"term\":\"merveilleuse\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027merveilleuse\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fashionable young Frenchwoman of the late 18th-century, characterized by extravagant dress sense and anti-revolutionary ideas\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, \u0027The Great Nation\u0027, Penguin 2003, p. 542\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"There were the mad fashions sported by the extraordinarily (by turns over- and under-) dressed \u0027Incroyables\u0027 and \u0027\u0027\u0027Merveilleuses\u0027\u0027\u0027, the guzzling of champagne, and the ingestion of bountiful meals in smart restaurants (a recent invention\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Helen Constantine, translating Choderlos de Laclos, \u0027Dangerous Liaisons\u0027 (1782), Penguin 2007, p. 111\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"You are the reason I arrived \u0027indecently\u0027 late at Madame de Volanges\u0027s and had all the old ladies thinking I was a \u0027\u0027\u0027Merveilleuse\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, \u0027Paris: The Secret History\u0027, Penguin 2007, p. 270\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The female equivalents were called \u0027\u0027\u0027Merveilleuses\u0027\u0027\u0027 and adopted Greek dress and espoused a neo-classical nostalgia\", \"priority\":7}]}, \"synonyms\":{}}");

	add("merveilleuse", "{\"term\":\"merveilleuse\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A female\", \"priority\":1}]}, \"synonyms\":{}}");

	add("merveilleux", "{\"term\":\"merveilleux\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From the French \u0027merveilleux\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the extravagantly dressed French and ‘fine ladies’ of the period of the w:French Directory, who affected a revival of the classical costume of ancient Greece\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"lt;small\u0026gt;\u0027\u00271819\u0027\u0027, \u0027The Metropolis: A Novel\u0027 (second edition), volume II, page 57:\u0026lt;/small\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"lt;small\u0026gt;I did not stay very late at the party; and our \u0027\u0027marvellous\u0027\u0027 promised to give us a list of the company..the ensuing day. [Cf. p. 59 Our military Exquisite.]\u0026lt;/small\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1892\u0027\u0027 October 19th, \u0027w:The Daily News The Daily News\u0027, page 5/1\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The ‘\u0027\u0027merveilleuse\u0027\u0027’ of the Directory in France. The ‘\u0027\u0027merveilleuse\u0027\u0027’, or ‘ultra-fashionable’, as the writer..rather inadequately translates her title, ‘walked..half naked in the Champs Elysees’\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1898\u0027\u0027, Mary Loyd (translator), (author), \u0027Fashion in Paris: The Various Phases of Feminine Taste and Æsthetics from 1797 to 1897\u0027, chapter i, page 8\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The Ecrouelleux, the Inconcevables, the \u0027\u0027Merveilleux\u0027\u0027, with their chins sunk in their huge cravats\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"ibidem\u0027, page 19\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027Merveilleuses\u0027\u0027 survived the Incroyables by a couple of years\", \"priority\":9}]}, \"synonyms\":{}}");

